import React from 'react';

import {SApp, SHeader} from "./assets/styles/app.styles";
import TodoList from './components/TodoList';

function App() {
    return (
        <SApp>
            <SHeader>
                <h1>Todo List</h1>
              <TodoList/> 
            </SHeader>
        </SApp>
    );
}

export default App;
